import React, { Component } from 'react';
import './App.css';

class App extends Component {
  foo = () => 'Bats';

  render() {
    //const name = 'Alex Bogdanov';
    const loading = true;

    return (
      <div className='App'>
        {loading ? <h4>Loading...</h4> : <h1>Hello {this.foo()}</h1>}
      </div>
    );
  }
}

export default App;
